import { Link } from "react-router-dom";

const Products = () => {
  return (
    <section>
      <h1>The Products page</h1>
      <ul>
        <li><Link>Product 1</Link></li>
        <li>Product 2</li>
        <li>Product 3</li>
      </ul>
    </section>
  );
};

export default Products;
